descricao:
Fralda descartável geriátrica, tamanho EG 
Com as seguintes especificações mínimas:
Composição: camada interna de não tecido, fibras de celulose, camada externa de polietileno, barreiras protetoras de polipropileno anti vazamento, fios de elastano, adesivo termo plástico.
Com formato anatômico; Hipoalergênica e dermatologicamente testada; Com fitas adesivas reposicionáveis; Com Dry Gel (super absorvente); Cobertura suave (não tecido); Com elástico para ajuste nas pernas; 
Peso: acima de 90 kg;

